    [],nt"revision_timestamp": "2016-01-06T06:10:00.472629",nt"name": "1983-digitized-shoreline-for-breton-island-louisiana-geographic-nad83",nt"isopen":
    false,nt"url": null,nt"notes": "Shorelines were derived from the National
    High Altitude Photography (NHAP) program. The NHAP was coordinated by the U.S. Geological
    Survey as an interagency project to acquire cloud-free aerial photographs at a specific
    altitude above mean terrain elevation. Two different camera systems were used to
    obtain simultaneous coverage of black-and-white (BW) and color infrared (CIR) aerial
    photographs over the conterminous United States. Black-and-white aerial photographs
    were obtained on 9-inch film from an altitude of 40,000 feet above mean terrain
    elevation and are centered over USGS 7.5-minute quadrangles. Images are at a scale
    of 1:80,000 (1 inch equals about 1.26 miles). All NHAP flights where flown in a
    north to south direction. Imagery was collected over Breton Island on November 17,
    1983. This dataset contains digitized shorelines created from the NHAP imagery for
    Breton Island, Louisiana. Shorelines were digitized in ArcMap 10.2.2 so they could
    be used for area and shoreline change analysis, using the Digital Shoreline Analysis
    System (DSAS) Version 4.0.",nt"license_title": null,nt"extras": [{ntt"key":
